import React from 'react';
import { Breadcrumb, BreadcrumbItem } from 'reactstrap';

const BreadcrumbExample = (props) => {
  return (
    <div>
      <Breadcrumb>
        <BreadcrumbItem active>Home</BreadcrumbItem>
      </Breadcrumb>
      <Breadcrumb>
        <BreadcrumbItem><a href="https://colorlib.com/" onClick={(e)=>e.preventDefault()}>Home</a> </BreadcrumbItem>
        <BreadcrumbItem active>Library</BreadcrumbItem>
      </Breadcrumb>
      <Breadcrumb>
        <BreadcrumbItem><a href="https://colorlib.com/" onClick={(e)=>e.preventDefault()}>Home</a> </BreadcrumbItem>
        <BreadcrumbItem><a href="https://colorlib.com/" onClick={(e)=>e.preventDefault()}>Library</a> </BreadcrumbItem>
        <BreadcrumbItem active>Data</BreadcrumbItem>
      </Breadcrumb>
    </div>
  );
};

export default BreadcrumbExample;
